import { createSlice } from '@reduxjs/toolkit'
const initialState = {
    places: [
        {
            "address": "Социалистическая улица, 7к2",
            "description": "3 марта стая собак утром напала на ребенка",
            "image": "data:image/jpg;base64,",
            "latitude": 56.1087132179586,
            "longitude": 47.17658611572258
        },
        {
            "address": "Ленинский район, Лакреевский лес",
            "description": "5 собак напали на мужчину",
            "image": "data:image/jpg;base64,",
            "latitude": 56.116386227079445,
            "longitude": 47.24490734374992
        },
        {
            "address": "улица Текстильщиков, 8к16",
            "description": "Укусили девушку",
            "image": "data:image/jpg;base64,",
            "latitude": 56.144683303661154,
            "longitude": 47.27443310058587
        }
    ]
}

export const mapSlice = createSlice({
    name: 'map',
    initialState,
    reducers: {
        addPlace: (state, action) => {
            let test = {
                "address": action.payload.adress.value,
                "description": action.payload.description,
                "image":  "data:image/jpg;base64,",
                "latitude": Number(action.payload.adress.data.geo_lat),
                "longitude": Number(action.payload.adress.data.geo_lon)
            }
            state.places.push(test)

        },
    },
})

// Action creators are generated for each case reducer function
export const { addPlace } = mapSlice.actions

export default mapSlice.reducer